      <style>
      body {
        background-image: -moz-linear-gradient(90deg);
      }

      .grid {
        column-count: 5;
        column-gap: 20px;
        z-index: 1;
      }

      .grid img {
        width: 100%;
        height: auto;
        object-fit: cover;
        transition: transform 0.2s ease;
        display: block; /* Prevents images from spanning across multiple columns */
        margin-bottom: 15px; /* Adds space between the images */
        break-inside: avoid; /* Prevents images from being split across columns */
      }

      .grid video {
        width: 100%;
        height: auto;
        object-fit: cover;
        display: block; /* Prevents videos from spanning across multiple columns */
        margin-bottom: 15px; /* Adds space between the videos */
        break-inside: avoid; /* Prevents videos from being split across columns */
      }

      .ball {
        position: absolute;
        border-radius: 100%;
        opacity: 0.7;
        z-index: -1;
      }



        /* Cool infinite background scrolling animation.
    * Twitter: @kootoopas
    */
    /* Exo thin font from Google. */
    @import url(https://fonts.googleapis.com/css?family=Exo:100);
    /* Background data (Original source: https://subtlepatterns.com/grid-me/) */
    /* Animations */
    @-webkit-keyframes bg-scrolling-reverse {
    100% {
        background-position: 50px 50px;
    }
    }
    @-moz-keyframes bg-scrolling-reverse {
    100% {
        background-position: 50px 50px;
    }
    }
    @-o-keyframes bg-scrolling-reverse {
    100% {
        background-position: 50px 50px;
    }
    }
    @keyframes bg-scrolling-reverse {
    100% {
        background-position: 50px 50px;
    }
    }
    @-webkit-keyframes bg-scrolling {
    0% {
        background-position: 50px 50px;
    }
    }
    @-moz-keyframes bg-scrolling {
    0% {
        background-position: 50px 50px;
    }
    }
    @-o-keyframes bg-scrolling {
    0% {
        background-position: 50px 50px;
    }
    }
    @keyframes bg-scrolling {
    0% {
        background-position: 50px 50px;
    }
    }
    /* Main styles */
    body {
    color: #999;
    font: 400 16px/1.5 exo, ubuntu, "segoe ui", helvetica, arial, sans-serif;

    <script>
      // Some random colors
      const colors = ["#3CC157", "#2AA7FF", "#1B1B1B", "#FCBC0F", "#F85F36"];

      const numBalls = 50;
      const balls = [];

      for (let i = 0; i < numBalls; i++) {
        let ball = document.createElement("div");
        ball.classList.add("ball");
        ball.style.background =
          colors[Math.floor(Math.random() * colors.length)];
        ball.style.left = `${Math.floor(Math.random() * 100)}vw`;
        ball.style.top = `${Math.floor(Math.random() * 100)}vh`;
        ball.style.transform = `scale(${Math.random()})`;
        ball.style.width = `${Math.random()}em`;
        ball.style.height = ball.style.width;

        balls.push(ball);
        document.body.append(ball);
      }

      // Keyframes
      balls.forEach((el, i, ra) => {
        let to = {
          x: Math.random() * (i % 2 === 0 ? -11 : 11),
          y: Math.random() * 12,
        };

        let anim = el.animate(
          [
            { transform: "translate(0, 0)" },
            { transform: `translate(${to.x}rem, ${to.y}rem)` },
          ],
          {
            duration: (Math.random() + 1) * 2000, // random duration
            direction: "alternate",
            fill: "both",
            iterations: Infinity,
            easing: "ease-in-out",
          }
        );
      });
    </script>
